script: |
  super -f text -I q5281.spq | sort > q5281.out

inputs:
  - name: q5281.spq
    data: |
      SELECT ALL col0 - 1 + - + 3 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN ( 37 + ( - - col0 ) * col0 + + + ( + col1 ) + + col2 ) AND ( - 88 );
  - name: tab0

outputs:
  - name: q5281.out
    data: |
